import React from "react";
import "primeicons/primeicons.css";
import "primereact/resources/primereact.min.css";
import { Card } from "primereact/card";

const header = ({ imnum }) => {
  const imgUrls = [
    "https://img-premium.flaticon.com/png/512/1298/1298189.png?token=exp=1623055061~hmac=cbccc00ce3232428125a8b8596b7c1a7",
    "https://img-premium.flaticon.com/png/512/1666/1666756.png?token=exp=1623055057~hmac=2c060aefc3b089e2b287b2cd59d9fbc1",
    "https://img-premium.flaticon.com/png/512/3928/3928721.png?token=exp=1623055165~hmac=314d83cb0725a8f52f4f921cb0f4a503",
  ];
  return <img alt="Card" src="" />;
};

const Intro = () => {
  return (
    <div className="p-d-flex p-jc-center p-ai-center p-flex-column">
      <div className="p-mb-2">
        This Web-App is created by
        <h2 className="p-px-2" style={{ fontFamily: "Montserrat" }}>
          Suryansh Chauhan
        </h2>
      </div>
      <div className="p-mb-2">
        This is a Molecule Viewer that allows the user to search for the
        structure of more than{" "}
        <h2 className="p-px-2" style={{ fontFamily: "Montserrat" }}>
          100 million compounds
        </h2>
      </div>
      <div className="p-d-flex">
        <Card
          title="Advanced Card"
          subTitle="Subtitle"
          style={{ width: "25em" }}
          header={header}
        ></Card>
      </div>
    </div>
  );
};

export default Intro;
